window.bookSummaryJSON = "<p><b>The New York Times best-selling security droid with a heart (though it wouldn't admit it!) is back in </b><b><i>Fugitive Telemetry</i></b><b>!&nbsp;</b></p> <p>Having captured the hearts of audiences across the globe (Annalee Newitz says it's \"one of the most humane portraits of a nonhuman I've ever read\"), Murderbot has also established Martha Wells as one of the great SF writers of today.&nbsp;</p> <p><i>No, I didn't kill the dead human. If I had, I wouldn't dump the body in the station mall. </i></p> <p>When Murderbot discovers a dead body on Preservation Station, it knows it is going to have to assist station security to determine who the body is (was), how they were killed (that should be relatively straightforward, at least), and why (because apparently that matters to a lot of people - who knew?).&nbsp;</p> <p>Yes, the unthinkable is about to happen: Murderbot must voluntarily speak to humans!&nbsp;</p> <p>Again!</p>"; 
